import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import './App.css';
import "primereact/resources/themes/saga-orange/theme.css";
import { RouterProvider, createBrowserRouter } from 'react-router-dom';
import { TicketTable } from './Components/TicketTable';
import { Form } from './Components/Form';
import BasicDemo from './Components/SideBarAdmin';
import { ReceiptTable } from './Components/ReceiptTable';

const root = ReactDOM.createRoot(document.getElementById('root'));

const router=createBrowserRouter([
    {
      path:'/',
      element:<Form/>
    },
    {
      path:'/listTickets',
      element:<TicketTable/>

    },
    {
      path: '/listReceipts', // Nueva ruta '/listReceipts'
      element: <ReceiptTable /> // Asocia la ruta con el componente ReceiptTable
  }
]);
root.render(
  <>
 <div>
      <h1>CNPC Chuanqing Drilling Engineering Company Limited (CCDC)    
      <img src="https://1000marcas.net/wp-content/uploads/2021/06/Logo-CNPC.jpg" className='imageLogo' alt="DescripciÃ³n de la imagen" />
      </h1>

  </div>

    <RouterProvider router={router}></RouterProvider>


    </>
);
